(18,	'Product Add (User)',	'mail_user_new_product',	'<!DOCTYPE html>\r\n<html lang=\"en\">\r\n\r\n<head>\r\n	<meta http-equiv=\"Content-Type\" content=\"text/html\" charset=\"utf-8\">\r\n	<title>Bizbook Mailers</title>\r\n</head>\r\n\r\n<body id=\"page-top\" class=\"index\">\r\n   <table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"width:100%;font-size:14px;font-family:Quicksand, Calibri, Arial, Verdana, sans-serif;background: #f5f6fa;color:#738196;line-height: 21px;padding: 30px;\">\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <table style=\"background: #fff;width:500px;padding: 20px;margin: 0 auto;box-shadow: 0px 1px 10px 13px #2d313703;border-radius: 8px;font-weight: 500;\">\r\n                        <tbody>\r\n                        <tr>\r\n                            <td style=\"font-size: 24px;color:#000;font-weight: bold;line-height: 30px;\">Hi <span contenteditable=\"false\">\' . $first_name . \'</span></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"height: 5px;line-height: 2px;\">&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Thanks for creating <strong><span contenteditable=\"false\">\' . $product_name . \'</span></strong>. Your Product has been successfully created. For reference, here\'s your product information:</td>\r\n                        </tr>     \r\n                        <tr><td>&nbsp;</td></tr>        \r\n                        <tr>\r\n                            <td style=\"font-size: 18px;color:#000;font-weight: bold;line-height: 26px;\">Product informations:</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><strong> Name:</strong> <span contenteditable=\"false\">\' . $product_name . \'</span></td>\r\n                        </tr>     \r\n                        <tr>\r\n                            <td><strong>Price :</strong> <span contenteditable=\"false\">\' . $product_price . \'</span></td>\r\n                        </tr> \r\n                        <tr>\r\n                            <td><strong>Payment link :</strong> <span contenteditable=\"false\">\' . $product_payment_link . \'</span></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><strong>Product tags :</strong> <span contenteditable=\"false\">\' . $product_tags . \'</span></td>\r\n                        </tr>\r\n                        <tr><td>&nbsp;</td></tr>    \r\n                        <tr>\r\n                            <td>Thanks, <br><span contenteditable=\"false\">\'.$admin_site_name.\'</span></td>\r\n                        </tr>    \r\n                    </tbody></table>\r\n                </td>\r\n            </tr>\r\n            \r\n        </tbody>\r\n    </table>\r\n</body>\r\n\r\n</html>'),
