price . \'</span></td>\r\n                        </tr> \r\n                        <tr>\r\n                            <td><strong>Payment link :</strong> <span contenteditable=\"false\">\' . $product_payment_link . \'</span></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><strong>Product tags :</strong> <span contenteditable=\"false\">\' . $product_tags . \'</span></td>\r\n                        </tr>\r\n                        <tr><td>&nbsp;</td></tr>    \r\n                        <tr>\r\n                            <td>Thanks, <br><span contenteditable=\"false\">\'.$admin_site_name.\'</span></td>\r\n                        </tr>    \r\n                    </tbody></table>\r\n                </td>\r\n            </tr>\r\n            \r\n        </tbody>\r\n    </table>\r\n</body>\r\n\r\n</html>'),
(20,	'Product Edit (User)',	'mail_user_edit_product',	'\r\n                        <style type=\"text/css\" rel=\"stylesheet\" media=\"all\">     /* Base ------------------------------ */\r\n    @import url(\"https://fonts.googleapis.com/css?family=Nunito+Sans:400,700&display=swap\");\r\n\r\n    body {\r\n        width: 100% !important;\r\n        height: 100%;\r\n        margin: 0;\r\n        -webkit-text-size-adjust: none\r\n    }\r\n\r\n    a {\r\n        color: #3869D4\r\n    }\r\n\r\n    a img {\r\n        border: none\r\n    }\r\n\r\n    td {\r\n        word-break: break-word\r\n    }\r\n\r\n    .preheader {\r\n        display: none !important;\r\n        visibility: hidden;\r\n        mso-hide: all;\r\n        font-size: 1px;\r\n        line-height: 1px;\r\n        max-height: 0;\r\n        max-width: 0;\r\n        opacity: 0;\r\n        overflow: hidden\r\n    }\r\n\r\n    body, td, th {\r\n        font-family: \"Nunito Sans\", Helvetica, Arial, sans-serif\r\n    }\r\n\r\n    h1 {\r\n        margin-top: 0;\r\n        color: #333;\r\n        font-size: 22px;\r\n        font-weight: 700;\r\n        text-align: left\r\n    }\r\n\r\n    h2 {\r\n        margin-top: 0;\r\n        color: #333;\r\n        font-size: 16px;\r\n        font-weight: 700;\r\n        text-align: left\r\n    }\r\n\r\n    h3 {\r\n        margin-top: 0;\r\n        color: #333;\r\n        font-size: 14px;\r\n        font-weight: 700;\r\n        text-align: left\r\n    }\r\n\r\n    td, th {\r\n        font-size: 16px\r\n    }\r\n\r\n    p, ul, ol, blockquote {\r\n        margin: .4em 0 1.1875em;\r\n        font-size: 16px;\r\n        line-height: 1.625\r\n    }\r\n\r\n    p.sub {\r\n        font-size: 13px\r\n    }\r\n\r\n    .align-right {\r\n        text-align: right\r\n    }\r\n\r\n    .align-left {\r\n        text-align: left\r\n    }\r\n\r\n    .align-center {\r\n        text-align: center\r\n    }\r\n\r\n    .button {\r\n        background-color: #3869D4;\r\n        border-top: 10px soli